import React from 'react';
import './Header.css';
import avatar from '../../asset/images/AvatarMaker.png';

const Header = () => {
    return (
        <header className='header'>
            <nav>
            <ul>
                <li></li></ul>    
            </nav>
            <section className='avatarHeader'>
                <img src={'/'} alt="" />
            </section> 
        </header>
    );
};

export default Header;
